CREATE TABLE `tb_cust_mst` (
                               `CUST_ID` VARCHAR(10) NOT NULL COMMENT '고객ID' COLLATE 'utf8mb4_bin',
                               `CUST_NM` VARCHAR(10) NOT NULL COMMENT '고객명' COLLATE 'utf8mb4_bin',
                               `CUST_PSWD` VARCHAR(20) NOT NULL DEFAULT '' COMMENT '비밀번호' COLLATE 'utf8mb4_bin',
                               `INHB_REG_NO` VARCHAR(13) NOT NULL COMMENT '주민등록번호' COLLATE 'utf8mb4_bin',
                               `BIRTH_DT` DATE NOT NULL COMMENT '생년월일',
                               `GENDER` CHAR(1) NOT NULL COMMENT '성별' COLLATE 'utf8mb4_bin',
                               `CUST_TEL_NO` VARCHAR(20) NOT NULL COMMENT '고객 연락처' COLLATE 'utf8mb4_bin',
                               `CUST_ADDRESS` VARCHAR(300) NOT NULL COMMENT '고객 주소' COLLATE 'utf8mb4_bin',
                               `REGT_DT` DATE NOT NULL COMMENT '가입일자',
                               `RGT_GUBUN` VARCHAR(2) NOT NULL DEFAULT '3' COMMENT '등록구분 1:직원/2:고객/3:SYS' COLLATE 'utf8mb4_bin',
                               `RGT_ID` VARCHAR(10) NOT NULL DEFAULT 'SYS' COMMENT '등록자ID' COLLATE 'utf8mb4_bin',
                               `RGT_DTM` DATETIME NOT NULL COMMENT '등록일자',
                               `MDF_ID` VARCHAR(10) NULL DEFAULT NULL COMMENT '수정자ID' COLLATE 'utf8mb4_bin',
                               `MDF_DTM` DATETIME NULL DEFAULT NULL COMMENT '수정일자',
                               PRIMARY KEY (`CUST_ID`) USING BTREE
)
    COMMENT='고객기본정보'
COLLATE='utf8mb4_bin'
ENGINE=InnoDB
;

CREATE TABLE `tb_bacnt_mst` (
                                `CUST_ID` VARCHAR(10) NOT NULL COMMENT '고객ID' COLLATE 'utf8mb4_bin',
                                `BACNT_NO` VARCHAR(20) NOT NULL COMMENT '계좌번호' COLLATE 'utf8mb4_bin',
                                `BACNT_PSWD` VARCHAR(6) NOT NULL DEFAULT '' COMMENT '계좌비밀번호' COLLATE 'utf8mb4_bin',
                                `BANK_CD` VARCHAR(10) NOT NULL COMMENT '은행코드' COLLATE 'utf8mb4_bin',
                                `BACNT_NM` VARCHAR(100) NOT NULL COMMENT '계좌명' COLLATE 'utf8mb4_bin',
                                `DPSTR_NM` VARCHAR(10) NOT NULL COMMENT '예급주명' COLLATE 'utf8mb4_bin',
                                `BACNT_BLNC` DECIMAL(15,0) UNSIGNED ZEROFILL NOT NULL COMMENT '계좌잔액',
                                `BACNT_ESTBL_YMD` DATETIME NOT NULL COMMENT '계좌개설일자',
                                `BACNT_MTRY_YMD` DATETIME NOT NULL COMMENT '계좌만기일자',
                                `BACNT_CNCL_YMD` DATETIME NULL DEFAULT NULL COMMENT '계좌해지일자',
                                `BACNT_TY` VARCHAR(2) NULL DEFAULT NULL COMMENT '계좌타입' COLLATE 'utf8mb4_bin',
                                `LIM_AMT` DECIMAL(10,0) NOT NULL COMMENT '한도',
                                `MNG_BRNCH_ID` VARCHAR(10) NOT NULL COMMENT '계좌관리지점' COLLATE 'utf8mb4_bin',
                                `BACNT_USE_YN` CHAR(1) NOT NULL DEFAULT 'Y' COMMENT '계좌사용여부' COLLATE 'utf8mb4_bin',
                                `VR_BACNT_YN` CHAR(1) NULL DEFAULT 'N' COMMENT '가상계좌여부' COLLATE 'utf8mb4_bin',
                                `RMRK` VARCHAR(300) NULL DEFAULT NULL COMMENT '비고' COLLATE 'utf8mb4_bin',
                                `RGT_GUBUN` VARCHAR(2) NOT NULL DEFAULT '3' COMMENT '등록구분 1:직원/2:고객/3:SYS' COLLATE 'utf8mb4_bin',
                                `RGT_ID` VARCHAR(10) NOT NULL DEFAULT 'SYS' COMMENT '등록자ID' COLLATE 'utf8mb4_bin',
                                `RGT_DTM` DATETIME NOT NULL COMMENT '등록일자',
                                `MDF_ID` VARCHAR(10) NULL DEFAULT NULL COMMENT '수정자ID' COLLATE 'utf8mb4_bin',
                                `MDF_DTM` DATETIME NULL DEFAULT NULL COMMENT '수정일자',
                                PRIMARY KEY (`BACNT_NO`) USING BTREE,
                                INDEX `FK_CUST_BACNT` (`CUST_ID`) USING BTREE,
                                CONSTRAINT `FK_CUST_BACNT` FOREIGN KEY (`CUST_ID`) REFERENCES `tb_cust_mst` (`CUST_ID`) ON UPDATE NO ACTION ON DELETE NO ACTION
)
    COMMENT='고객계좌'
COLLATE='utf8mb4_bin'
ENGINE=InnoDB
;


